import React from 'react';

export const ProfileImage = ({
  src,
  alt = "Profile image"
}) => {
  return (
    <div className="flex flex-col w-[33%] max-md:w-full">
      <div className="flex-grow w-full max-md:mt-10 max-md:max-w-full">
        <div className="flex gap-5 max-md:flex-col">
          <div className="flex flex-col w-full">
            <img
              loading="lazy"
              src={src}
              alt={alt}
              className="grow w-full aspect-[0.98] max-md:max-w-full"
            />
          </div>
        </div>
      </div>
    </div>
  );
};
